import React, { Component } from "react";
import { Routes, Route } from "react-router-dom";



export default class Headers extends React.Component {

    render() {
        return(
            <header>
                <nav class="navbar bg-body-tertiary">
                    <div class="container-fluid">
                        <p>Navbar</p>
                    </div>
                </nav>
            </header>
        );
    }
}
